  const [bad, setBad] = useState(0)

  const addGood = () => {
    console.log('good')
  }

  return (
    <div>
      <button onClick={addGood}>Good</button>
      <button>Neutral</button>
      <button>Bad</button>
      <p>Good {good}</p>
      <p>Neutral {neutral}</p>
      <p>Bad {bad}</p>
    </div>
  )
}

export default App
